import React, { Component } from 'react';
import { HeaderWrapper, BrokerName } from './HeaderSection.styled.js';

class HeaderSection extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <HeaderWrapper>
        <BrokerName>{this.props.data.broker.name}</BrokerName>
        <div>
          <span>Wesbite: </span>
          <span>www.somecoolsite.com</span>
        </div>
        <div>
          <span>Description:</span>
          <span>I am an awesome business</span>
        </div>
      </HeaderWrapper>
    );
  }
}

export default HeaderSection;
